  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"docker---saving-to-a-new-container"}}>{`Docker - saving to a new container`}</MDXTag>
<MDXTag name="p" components={components}><MDXTag name="inlineCode" components={components} parentName="p">{`docker commit c3f279d17e0a svendowideit/testimage:version3`}</MDXTag></MDXTag>
           </MDXTag>
  }
}
